import React, { useEffect } from 'react'
import './styles.css' ; 
import {fetchGlobalData , fetchCountries} from './api' 
import {Bar , defaults} from 'react-chartjs-2' ; 
const App = () => {
    defaults.plug
    return (
        <React.Fragment>
            <Bar
            data = {{
                labels:['Total Cases' , 'Recorvered' , 'Deaths'] , 
                datasets:[
                    {
                        label:"Total Cases" , 
                        data:[23]
                    } , 
                    {
                        label:"Total Cases"
                    } , 
                    {
                        label:"Total Cases"
                    }
                ]
            }}
            />
        </React.Fragment>
    )
}

export default App
